import React from "react";
import logo from '../../imgs/logo.jpg'; 

function Login() {
  return (
    <div className="bg-gradient-to-r from-black to-green-500 w-screen h-screen">
        <div className="flex justify-around">
            <div className="">
                <img src={logo} alt="Logo da XYZ Distribuidora"/>
            </div>
            <div className="w-80 h-96 bg-gradient-to-t from-green-500 to-blue-500 border-4 border-black">
                
            </div>
        </div>
    </div>
  );
}

export default Login;
